def load_skeleton_from_json(data_path, file_name):
    json_path = os.path.join(data_path, file_name, file_name + '.json')
    if not os.path.exists(json_path):
        return None
    with open(json_path, 'r') as f:
        json_file = json.load(f)
    skeletons = json_file['skeletons']
    value = np.array(skeletons)
    center = value[0, 1, :]
    value = value - center
    scalerValue = np.reshape(value, (-1, 3))
    v_min, v_max = np.min(scalerValue, axis=0), np.max(scalerValue, axis=0)
    scalerValue = (scalerValue - v_min) / (v_max - v_min + 1e-6)
    scalerValue = scalerValue * 2 - 1
    scalerValue = np.reshape(scalerValue, (-1, 20, 3))
    length = scalerValue.shape[0]
    data = np.zeros((WINDOW_SIZE, 20, 3))
    idx = np.linspace(0, length - 1, WINDOW_SIZE).astype(int)
    data[:, :, :] = scalerValue[idx, :, :]
    data = np.transpose(data, (2, 0, 1))
    data = np.reshape(data, (3, WINDOW_SIZE, 20, 1))
    return data.astype(np.float32)


def process_all(data_path, rgb_input_path, output_path, weights_path):
    print(">>> ang khi to m hnh CTR-GCN...")
    model = CTRGCN(
        num_class=MODEL_NUM_CLASS,
        num_point=MODEL_NUM_POINT,
        num_person=MODEL_NUM_PERSON,
        graph=MODEL_GRAPH,
        graph_args=MODEL_GRAPH_ARGS,
        in_channels=MODEL_IN_CHANNELS
    ).to(device)

    if weights_path and os.path.exists(weights_path):
        print(f">>> Loading weights t: {weights_path}")
        try:
            model.load_state_dict(torch.load(weights_path, map_location=device))
            print(">>> Load weights thnh cng!")
        except Exception as e:
            print(f"!!! Khng load c weights ({e}). Dng weights ngu nhin.")
    else:
        print("!!! Khng tm thy weights. Dng weights ngu nhin.")
    model.eval()

    if not os.path.exists(output_path):
        os.makedirs(output_path)

    all_files = [f for f in os.listdir(rgb_input_path) if f.endswith('.png')]
    print(f"Tm thy {len(all_files)} nh ST-ROI ti {rgb_input_path}")
    print("Bt u to nh weighted...")
    count = 0

    for img_file in tqdm(all_files):
        file_name = os.path.splitext(img_file)[0]

        skeleton_data = load_skeleton_from_json(data_path, file_name)
        if skeleton_data is None:
            continue

        x_ske = torch.tensor(skeleton_data).unsqueeze(0).float().to(device)

        with torch.no_grad():
            _, feature = model.extract_feature(x_ske)

        intensity_s = (feature * feature).sum(dim=1) ** 0.5
        intensity_s = intensity_s.cpu().detach().numpy()
        feature_s = np.abs(intensity_s)
        if (feature_s.max() - feature_s.min()) != 0:
            feature_s = 255 * (feature_s - feature_s.min()) / (feature_s.max() - feature_s.min())

        N, C_feat, T_feat, V, M = x_ske.size()

        target_h_map = 225
        target_w_map = 45 * TEMPORAL_RGB_FRAMES

        weight = np.full((1, 1, target_h_map, target_w_map), 0.0)

        n = 0
        person_idx = 0
        if M > 1:
            if feature_s[n, :, :, 0].mean() < feature_s[n, :, :, 1].mean():
                person_idx = 1

        for j, v in enumerate(TARGET_JOINTS):
            if v < V:
                feature_val = feature_s[n, :, v, person_idx]
                temp = np.partition(-feature_val, min(TEMPORAL_POSITIONS, len(feature_val) - 1))
                avg_feat = -temp[:TEMPORAL_POSITIONS].mean()
                if 45 * (j + 1) <= target_w_map:
                    weight[0, 0, 45 * j:45 * (j + 1), :] = avg_feat

        weight_cuda = torch.from_numpy(weight).float().to(device)
        weight_cuda = weight_cuda / 127.0

        img_path = os.path.join(rgb_input_path, img_file)
        rgb_img = Image.open(img_path).convert('RGB')
        rgb_np = np.array(rgb_img).astype(np.float32)
        rgb_tensor = torch.from_numpy(rgb_np).permute(2, 0, 1).unsqueeze(0).float().to(device)

        _, _, H_rgb, W_rgb = rgb_tensor.size()
        weight_resized = torch.nn.functional.interpolate(
            weight_cuda, size=(H_rgb, W_rgb), mode='bilinear', align_corners=False
        )

        rgb_weighted = rgb_tensor * weight_resized

        img_result = rgb_weighted[0].permute(1, 2, 0).cpu().numpy()
        img_result = np.clip(img_result, 0, 255).astype(np.uint8)

        out_path = os.path.join(output_path, img_file)
        Image.fromarray(img_result).save(out_path)
        count += 1

    print(f"\nHon tt!  to {count} nh weighted ti: {output_path}")


if __name__ == "__main__":
    DATA_PATH = './data/nucla/'
    process_all(DATA_PATH, INPUT_RGB_PATH, OUTPUT_PATH, WEIGHTS_PATH)
